  assemblies:
  - Mapsui
  namespace: Mapsui.Fetcher
  summary: >-
    Executes the method passed as argument with a possible delay. After a previous

    call the next call is delayed until 'MillisecondsToWait' has passed.

    When ExecuteRequest is called before the previous delayed action was executed 

    the previous one will be cancelled.
  remarks: >-
    When the previous call was more than 'MillisecondsToWait' ago there will
        be no delay.
  example: []
  syntax:
    content: public void ExecuteDelayed(Action action)
    parameters:
    - id: action
      type: System.Action
      description: The action to be executed after the possible delay
    content.vb: Public Sub ExecuteDelayed(action As Action)
  overload: Mapsui.Fetcher.Delayer.ExecuteDelayed*
